      <div className="tab3-contentainer">
        <div>
          <div>
            <Chart1 data={chartOneData} />
          </div>
          <div>
            <Chart2 startDate={startDate} endDate={endDate} />
          </div>
        </div>
        <div>qqqq</div>
      </div>
    </div>
  );
};

export default Tab3;
